import React from "react";

export default class Basket extends React.Component {
    componentDidMount(){
        console.log('component did moutnt');
        this.props.getCartProducts()
    }
    render(){
        console.log('props cart', this.props);
        const list = this.props.products.map((elem, index) => {
            return (
                <div key={index}>
                    {elem.name}
                </div>
            )
        })
        return (
            <>
                <div><b>Cart</b></div>
                <div>{list}</div>
            </>
        )
    }
}
